window.bookSummaryJSON = "<p><i>They think they know me, but they have no idea.</i></p> <p>As a professional Domme, I see men and women come and go. But no one ever sticks around, and I like it that way.</p> <p>I have a secret to protect—at all costs.</p> <p>So when the cocky, handsome, and submissive Clay Bradley weasels his way into my heart, I do the one thing I’ve always excelled at. I push him away—forever.</p> <p>And like a good boy, he listens.</p> <p>But a few months later, during a chance encounter,<i> </i>he shows up again, but this time he isn’t alone.</p> <p>He has the stunning Jade on his arm.</p> <p>And she has a request of her own. She wants me to <i>teach</i> her.</p> <p>I should say no.</p> <p>Training a woman who makes my knees weak is bad enough. But this particular woman is dating the man who still has my heart. It’s a recipe for disaster.</p> <p>Made worse by one simple thing: they know my secret.</p> <p>And they won’t let go.</p> <p>But how can I protect what’s mine if I’m holding onto them too?</p> <p>Jade and Clay are the only ones who truly see me and the only ones who know…</p> <p>I’m so much more than Madame.</p>"; 
